// src/components/RegistrationPage.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Button,
  TextField,
  Typography,
  Container,
  Grid,
  Box,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';

const RegistrationPage = () => {
  const navigate = useNavigate();

  const [registrationType, setRegistrationType] = useState('');
  const [registrationDetails, setRegistrationDetails] = useState({
    name: '',
    email: '',
    phoneNumber: '',
    aadharNumber: '',
    password: '',
    username: '',
  });

  const [error, setError] = useState({
    name: false,
    email: false,
    phoneNumber: false,
    aadharNumber: false,
    password: false,
    username: false,
    existingEmail: false,
    existingAadhar: false,
  });

  const handleRegistrationTypeChange = (event) => {
    setRegistrationType(event.target.value);
  };

  const handleRegistrationDetailsChange = (field, value) => {
    let isValid = true;

    // Validation logic
    if (field === 'name') {
      isValid = value.trim() !== '';
    } else if (field === 'email') {
      isValid = /\S+@\S+\.\S+/.test(value);
    } else if (field === 'phoneNumber' || field === 'aadharNumber') {
      isValid = /^\d{10,12}$/.test(value);
    } else if (field === 'password') {
      isValid = value.length >= 6;
    } else if (field === 'username') {
      isValid = value.trim() !== '';
    }

    setError((prevError) => ({
      ...prevError,
      [field]: !isValid,
      existingEmail: false,
      existingAadhar: false,
    }));

    setRegistrationDetails((prevDetails) => ({
      ...prevDetails,
      [field]: value,
    }));
  };

  const handleRegister = async () => {
    try {
      // Validation before submitting
      if (!validateInput()) {
        return;
      }

      const response = await fetch('http://localhost:3001/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          ...registrationDetails,
          type: registrationType,
        }),
      });

      if (response.ok) {
        console.log('Registration successful');
        navigate('/');
      } else {
        const data = await response.json();
        console.error('Registration failed:', data.error);

        setError((prevError) => ({
          ...prevError,
          ...(data.validationErrors || {}),
        }));
      }
    } catch (error) {
      console.error('Error during registration:', error);
    }
  };

  const validateInput = () => {
    let isValid = true;

    // Reset errors
    setError({
      name: false,
      email: false,
      phoneNumber: false,
      aadharNumber: false,
      password: false,
      username: false,
      existingEmail: false,
      existingAadhar: false,
    });

    // Validate name
    if (registrationDetails.name.trim() === '') {
      setError((prevError) => ({
        ...prevError,
        name: true,
      }));
      isValid = false;
    }

    // Validate email format
    if (!/\S+@\S+\.\S+/.test(registrationDetails.email)) {
      setError((prevError) => ({
        ...prevError,
        email: true,
      }));
      isValid = false;
    }

    // Validate phone number format
    if (!/^\d{10,12}$/.test(registrationDetails.phoneNumber)) {
      setError((prevError) => ({
        ...prevError,
        phoneNumber: true,
      }));
      isValid = false;
    }

    // Validate Aadhar number format
    if (!/^\d{12}$/.test(registrationDetails.aadharNumber)) {
      setError((prevError) => ({
        ...prevError,
        aadharNumber: true,
      }));
      isValid = false;
    }

    // Validate password length
    if (registrationDetails.password.length < 6) {
      setError((prevError) => ({
        ...prevError,
        password: true,
      }));
      isValid = false;
    }

    // Validate username
    if (registrationDetails.username.trim() === '') {
      setError((prevError) => ({
        ...prevError,
        username: true,
      }));
      isValid = false;
    }

    return isValid;
  };

  const checkExistingEmailAndAadhar = async () => {
    try {
      const response = await fetch('http://localhost:3001/check-existing', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email: registrationDetails.email,
          aadharNumber: registrationDetails.aadharNumber,
        }),
      });

      if (response.ok) {
        const data = await response.json();

        if (data.existingEmail) {
          setError((prevError) => ({
            ...prevError,
            existingEmail: true,
          }));
        }

        if (data.existingAadhar) {
          setError((prevError) => ({
            ...prevError,
            existingAadhar: true,
          }));
        }
      } else {
        const data = await response.json();
        console.error('Error checking existing email and Aadhar:', data.error);
      }
    } catch (error) {
      console.error('Error during existing email and Aadhar check:', error);
    }
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Typography component="h1" variant="h5">
          Register
        </Typography>
        <Box
          component="form"
          noValidate
          sx={{
            width: '100%',
            marginTop: 1,
          }}
        >
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <FormControl fullWidth>
                <InputLabel id="registration-type-label">Registration Type</InputLabel>
                <Select
                  labelId="registration-type-label"
                  id="registration-type"
                  value={registrationType}
                  label="Registration Type"
                  onChange={handleRegistrationTypeChange}
                >
                  <MenuItem value="contractor">Contractor</MenuItem>
                  <MenuItem value="subcontractor">Worker</MenuItem>
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12}>
              {/* Name Field */}
              <TextField
                label="Full Name"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.name}
                onChange={(e) => handleRegistrationDetailsChange('name', e.target.value)}
                error={error.name}
                helperText={error.name ? 'Enter a valid name' : ''}
              />
            </Grid>
            <Grid item xs={12}>
              {/* Username Field */}
              <TextField
                label="Username"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.username}
                onChange={(e) => handleRegistrationDetailsChange('username', e.target.value)}
                error={error.username}
                helperText={error.username ? 'Enter a valid username' : ''}
              />
            </Grid>
            <Grid item xs={12}>
              {/* Email Field */}
              <TextField
                label="Email"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.email}
                onBlur={checkExistingEmailAndAadhar}
                onChange={(e) => handleRegistrationDetailsChange('email', e.target.value)}
                error={error.email || error.existingEmail}
                helperText={error.existingEmail
                  ? 'Email already exists'
                  : error.email
                  ? 'Enter a valid email address'
                  : ''
                }
              />
            </Grid>
            <Grid item xs={12}>
              {/* Phone Number Field */}
              <TextField
                label="Phone Number"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.phoneNumber}
                onChange={(e) => handleRegistrationDetailsChange('phoneNumber', e.target.value)}
                error={error.phoneNumber}
                helperText={error.phoneNumber ? 'Enter a valid 10-digit phone number' : ''}
                inputProps={{ maxLength: 10 }}
              />
            </Grid>
            <Grid item xs={12}>
              {/* Aadhar Number Field */}
              <TextField
                label="Aadhar Number"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.aadharNumber}
                onBlur={checkExistingEmailAndAadhar}
                onChange={(e) => handleRegistrationDetailsChange('aadharNumber', e.target.value)}
                error={error.aadharNumber || error.existingAadhar}
                helperText={error.existingAadhar
                  ? 'Aadhar number already exists'
                  : error.aadharNumber
                  ? 'Enter a valid 12-digit Aadhar number'
                  : ''
                }
                inputProps={{ maxLength: 12 }}
              />
            </Grid>
            <Grid item xs={12}>
              {/* Password Field */}
              <TextField
                label="Password"
                type="password"
                variant="outlined"
                fullWidth
                margin="normal"
                value={registrationDetails.password}
                onChange={(e) => handleRegistrationDetailsChange('password', e.target.value)}
                error={error.password}
                helperText={error.password ? 'Password must be at least 6 characters' : ''}
              />
            </Grid>
            <Grid item xs={12}>
              {/* File Upload Field */}
              <input type="file" accept="image/*" />
            </Grid>
            <Grid item xs={12}>
              {/* Register Button */}
              <Button variant="contained" fullWidth onClick={handleRegister}>
                Register
              </Button>
            </Grid>
          </Grid>
        </Box>
      </Box>
    </Container>
  );
};

export default RegistrationPage;
